css:
.fuzzy-finder .list-group .character-match {
  color: #b7c5d3;
  font-weight: bold;
}
.FuzzyFinderResult {
  position: relative;
}
.FuzzyFinderResult.has-avatar {
  padding-right: 60px !important;
}
.FuzzyFinderResult-avatar {
  position: absolute !important;
  border-radius: 28px;
  width: 28px;
  top: 50%;
  margin-top: -14px;
  right: 16px;
}
.fuzzy-finder .experiment-prompt {
  display: flex;
  justify-content: flex-end;
}
.fuzzy-finder .experiment-prompt .badge {
  margin-right: 8px;
}
